import React from 'react'
import './Main.scss'

class Main extends React.Component {
    render() {
        return (
            <div className='Main'>
                <h1>Today</h1>
                <div className="btn-group-toggle" data-toggle="buttons">
                    <label className="btn btn-secondary active">
                        <input type="checkbox" checked>Checked</input>
                    </label>
                </div>
            </div>
        )
    }
}

export default Main
